import React from 'react';
import {  Link } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle';
import { Button, Navbar, Container, Nav, NavDropdown } from 'react-bootstrap'

const NavbarComponent= () =>{
  return (
    <Container>
      <Navbar fixed="top" bg="" expand="lg" className=''>
    <Container>
      <Navbar.Brand href="#home">
        <img className='logo' src='https://drive.google.com/uc?export=view&id=17pfbOu6rCq31VgLfHRBb3-kX3COiR-NG' alt='image'/>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav" className=''>
        <Nav className="ms-auto">
          <Nav.Link href="#home" style={{fontSize: "25px"}}>Home</Nav.Link>
          <Nav.Link href="#link" style={{fontSize: "25px"}}>Về chúng tôi </Nav.Link>
          
          {/*<NavDropdown title="Dropdown" id="basic-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
            </NavDropdown>*/}
        </Nav>
      </Navbar.Collapse>
    </Container>
    </Navbar>
    <div>
    </div>
    </Container>
    
  );
}
export default NavbarComponent;
